function loadStoreSearchData(e){$.ajax({url:"https://cors-anywhere.herokuapp.com/https://www.systembolaget.se/api/assortment/stores/xml",success:function(t){findStore(e,t)},datatype:"xml",error:function(){alert("Error: Something went wrong with loding stores ")}})}function findStore(e,t){for(var o=[],n=[],a=0;a<t.getElementsByTagName("ButikOmbud").length;a++)t.getElementsByTagName("ButikOmbud")[a].childNodes[6].textContent===e.toUpperCase()&&"Ombud"!==t.getElementsByTagName("ButikOmbud")[a].childNodes[0].textContent&&(o.push(t.getElementsByTagName("ButikOmbud")[a].childNodes[3].textContent),n.push(t.getElementsByTagName("ButikOmbud")[a].childNodes[1].textContent));placeStores(o,e.toUpperCase(),n)}function loadStoreInventoryData(e,t){$.ajax({url:"https://cors-anywhere.herokuapp.com/https://www.systembolaget.se/api/assortment/stock/xml",success:function(o){getStoreIventory(e,t,o)},datatype:"xml",error:function(){alert("Error: Something went wrong")}})}function getStoreIventory(e,t,o){for(var n=[],a=0;a<o.getElementsByTagName("Butik").length;a++)if(o.getElementsByTagName("Butik")[a].getAttribute("ButikNr")===t){for(var r=0;r<o.getElementsByTagName("Butik")[a].childNodes.length;r++)n.push(o.getElementsByTagName("Butik")[a].childNodes[r]);a=o.getElementsByTagName("Butik").length}loadArtikelInfoDataForStore(n,e)}function loadArtikelInfoDataForStore(e,t){$.ajax({url:"https://cors-anywhere.herokuapp.com/https://www.systembolaget.se/api/assortment/products/xml",success:function(o){getArtikelInfoForStore(e,o,t)},datatype:"xml",error:function(){alert("Error: Something went wrong")}})}function getArtikelInfoForStore(e,t,o){for(var n=[],a=0;a<e.length;a++)for(var r=0;r<t.getElementsByTagName("artikel").length;r++)t.getElementsByTagName("artikel")[r].childNodes[0].textContent==e[a].textContent&&(t.getElementsByTagName("artikel")[r].childNodes[3].textContent.toLowerCase().includes(o)||t.getElementsByTagName("artikel")[r].childNodes[3].textContent.toLowerCase()===o||t.getElementsByTagName("artikel")[r].childNodes[4].textContent.toLowerCase().includes(o)||t.getElementsByTagName("artikel")[r].childNodes[10].textContent.toLowerCase()===o)&&n.push(t.getElementsByTagName("artikel")[r]);buildSearchResultTable(n,n.length,o)}function loadAllArtikels(){$.ajax({url:"https://cors-anywhere.herokuapp.com/https://www.systembolaget.se/api/assortment/products/xml",success:function(e){getAllInventory(e)},datatype:"xml",error:function(){alert("Error: Something went wrong")}})}function getAllInventory(e){for(var t=[],o=e.getElementsByTagName("artikel").length,n=0;n<o;n++)t.push(e.getElementsByTagName("artikel")[n])}$(document).ready(function(){});